import { Box, Typography } from "@mui/material";
import React from "react";

function PlayStore() {
  return (
    <Box
      sx={{
        display: "grid",
        maxWidth: "100%",
        margin: "0 auto",
        padding: 0,
        height: "650px",
        backgroundColor: "#e3f2fd",
        marginTop: "100px",
        textAlign:'start', // Aligns text center
      }}
    >
      <Typography
        sx={{
          fontFamily: "Manrope, sans-serif !important",
          fontSize: "2.9rem",
          fontWeight: "700",
          lineHeight: 1.2,
          padding:'65px',
          letterSpacing: "0.015em",
          wordSpacing: "0.001em",
        }}
      >
        Download the{" "}
        <Box
          component="span"
          sx={{
            color: "#3593b0",
            position: "relative",
            display: "inline-block",
            "&::after": {
              content: '""',
              position: "absolute",
              left: 0,
              bottom: "-5px",
              width: "100%",
              height: "4px",
              backgroundColor: "black",
              borderRadius: "5px",
            },
          }}
        >
          MyMoneyMantra
        </Box>
        <br />
        Mobile App
      </Typography>
    </Box>
  );
}

export default PlayStore;
